  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC ADMINISTRATIVE PROCEEDING RELEASE 34-57677, INVESTMENT ADVISERS RELEASE 40-2726, APRIL 17, 2008: THE SECURITIES AND EXCHANGE COMMISSION (\"COMMISSION\") FILED  PUBLIC ADMINISTRATIVE PROCEEDINGS AGAINST GARY L. LANCASTER PURSUANT TO SECTION 15(B) OF THE SECURITIES EXCHANGE ACT OF 1934 (\"EXCHANGE ACT\") AND SECTION 203(F) OF THE INVESTMENT ADVISERS ACT OF 1940 BASED ON  A FINAL JUDGMENT ENTERED BY CONSENT AGAINST LANCASTER ON MARCH 27, 2008 , PERMANENTLY ENJOINING HIM FROM FUTURE VIOLATIONS OF SECTIONS 5(A), 5(C), AND 17(A) OF THE SECURITIES ACT OF 1933 (\"SECURITIES ACT\"), SECTIONS 10(B) AND 15(A) OF THE EXCHANGE ACT AND RULE 10B-5 THEREUNDER, AND SECTIONS 206(1) AND 206(2) OF THE ADVISERS ACT, IN THE CIVIL ACTION NUMBER 3-08CV-526-L, IN THE UNITED STATES DISTRICT COURT FOR THE NORTHERN DISTRICT OF TEXAS, DALLAS DIVISION.  THE COMMISSION'S COMPLAINT ALLEGED, AMONG OTHER THINGS, THAT IN CONNECTION WITH THE OFFER AND SALE OF SECURITIES, LANCASTER KNEW OR WAS SEVERELY RECKLESS IN MAKING MATERIALLY FALSE AND MISLEADING STATEMENTS CONCERNING THE FUND, THAT LANCASTER MISUSED AND MISAPPROPRIATED INVESTOR FUNDS, AND THAT LANCASTER OTHERWISE ENGAGED IN A VARIETY OF CONDUCT THAT OPERATED AS A FRAUD AND DECEIT ON INVESTORS. THE COMPLAINT ALSO ALLEGED THAT LANCASTER OFFERED AND SOLD SECURITIES IN UNREGISTERED TRANSACTIONS.",
  "Resolution" : "Order",
  "SanctionDetails" : [ {
    "Sanctions" : "Bar"
  } ],
  "Sanction Details" : "WITHOUT ADMITTING OR DENYING THE FINDINGS RESPONDENT CONSENTS TO THE ENTRY OF THIS ORDER.  ACCORDINGLY, IT IS ORDERED THAT:  PURSUANT TO SECTION 15(B)(6) OF THE EXCHANGE ACT AND SECTION 203(F) OF THE ADVISERS ACT RESPONDENT IS BARRED FROM ASSOCIATION WITH ANY BROKER OR DEALER OR INVESTMENT ADVISER."
}

