  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC LITIGATION RELEASE 20512, MARCH 27, 2008: SECTIONS 5(A), 5(C) AND 17(A) OR THE SECURITIES ACT OF 1933 (SECURITIES ACT), SECTIONS 10(B) AND 15(A) OF THE SECURITIES EXCHANGE ACT OF 1934 (EXCHANGE ACT) AND RULE 10B-5 THEREUNDER, SECTIONS 206(1) AND 206(2) OF THE INVESTMENT ADVISERS ACT OF 1940 (ADVISERS ACT) - ON MARCH 26, 2008, THE SECURITIES AND EXCHANGE COMMISSION (\"COMMISSION\") FILED A COMPLAINT IN THE UNITED STATES DISTRICT COURT FOR THE NORTHERN DISTRICT OF TEXAS AGAINST GARY L. LANCASTER, AND OTHERS (COLLECTIVELY, \"DEFENDANTS\") FOR THEIR ROLES IN THE FRAUDULENT AND UNREGISTERED OFFER AND SALE OF INTERESTS IN A FUND (\"FUND\"). IN ITS COMPLAINT, THE COMMISSION ALLEGED THAT IN EARLY 2003, LANCASTER CREATED THE FUND AT A CO-DEFENDANT'S DIRECTION. LANCASTER THEN CREATED A MATERIALLY FALSE AND MISLEADING PRIVATE PLACEMENT MEMORANDUM (PPM) FOR THE FUND, AND BETWEEN AT LEAST MARCH 2003 AND JULY 2005, THE DEFENDANTS OFFERED AND SOLD INTERESTS IN THE FUND WITH FALSE PROMISES CONCERNING THE PERMISSIBLE INVESTMENTS, THE PAYMENT OF COMMISSIONS, AND THE PAYMENT OF MANAGEMENT FEES. INSTEAD, THE COMPLAINT ALLEGED THAT THE DEFENDANTS DIRECTED THE FUND TO INVEST OVER $9 MILLION IN A FRAUDULENT, HIGH-YIELD PONZI SCHEME, PAID LANCASTER A MANAGEMENT FEE WELL IN EXCESS OF THAT ALLOWED BY THE PPM.",
